import React from 'react';
import './Ourstats.css';
import CountUp from 'react-countup';

function Ourstats() {
  return (
    <div className='stats-container'>
        <div className='stats-items'>
        <div className='stat'> <CountUp end={90} duration={5} suffix={"+ members"} enableSpyscroll scrollSpyOnce={true} useEasing /> </div>
        <div className='stat'> <CountUp end={1000} duration={5} suffix={"+ memories created"} scrollSpyOnce useEasing/> </div>
        <div className='stat'> <CountUp end={1} duration={2} suffix={" commuinity made"} scrollSpyOnce useEasing/> </div>
        </div>
    </div>  
  )
}

export default Ourstats
